const paletteBase = {
  primary: {
    light: "#9FF1D2",
    main: "#127C71",
    dark: "#0D6A69",
    contrastText: "#fbfbfb",
  },
  secondary: {
    light: "#FDE6A8",
    main: "#ffaf35",
    dark: "#D0821C",
    contrastText: "#fbfbfb",
  },
};

export default paletteBase;
